    },
    isAudio(fileName) {
      return (
        fileName.toLowerCase().includes(".mp3") ||
        fileName.toLowerCase().includes(".wma") ||
        fileName.toLowerCase().includes(".aac") ||
        fileName.toLowerCase().includes(".ogg") ||
        fileName.toLowerCase().includes(".m4a")
      );
