    getData() {
      let self = this;
      dsf.http
        .post(`fn/conferenceMobile/meetingTopics`, {
          meetingId: self.meeting.id
        })
        .done(result => {
          if (result.code == 200 && result.data.length > 0) {
            self.topics = result.data;
            this.activeNames = [];
            self.topics.forEach((item, index) => {
              this.activeNames.push(index);
